import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var AlignJustify = createReactComponent("AlignJustify", ["svg", defaultAttributes, [["line", {
  x1: "3",
  y1: "6",
  x2: "21",
  y2: "6",
  key: "1jdu5d"
}], ["line", {
  x1: "3",
  y1: "12",
  x2: "21",
  y2: "12",
  key: "thangg"
}], ["line", {
  x1: "3",
  y1: "18",
  x2: "21",
  y2: "18",
  key: "ktql6o"
}]]]);
export default AlignJustify;
